import './ExpenseItem.css'

function ExpenseItem() {
  return (
	<div>
		<div>January 28th 2022</div>
		<div>
			<h2>Car Insurance</h2>
			<div>$294.67</div>
		</div>
	</div>)
}

export default ExpenseItem;
